import React, { useEffect, useState} from 'react'
import beesoul from '../Assests/beesoul.png';



const Navbar = () => {

  const navItems = [
    { link: "Home", path:"home"},
    { link: "About Us", path:"home"},
    { link: "Services", path:"home"},
    { link: "Contact Us", path:"home"},
  ];

  return (
    <div> 
      <a className='' href='/'> <img className='ml-10 py-5' src={beesoul} alt =""/>  </a>
      <ul className='md:flex space-x-12 hidden'>
        {
          navItems.map ((link,path)=><link key={path} to={path}>{link}</link> )
        }
      </ul>
    </div>
  )
}

export default Navbar
